import { useParams } from "react-router-dom";
import timelineElements from "../timelineElements.js";
import { APIProvider, Map } from '@vis.gl/react-google-maps';
import Iframe from 'react-iframe';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Wspomnienie() {
    const API_KEY = "AIzaSyAxnnVtUtw8tvuZg28S9VHTsmJ89ai1byk";
    const params = useParams();
    const element = timelineElements[params.wspomnieniaId-1];
    return (
        <Container>
            <Row>
                <Col>
                    <h1 className="title">{element.title}</h1>
                </Col>
            </Row>
            <Row>
                <Col>
                    <div className="map">
                    <APIProvider apiKey={API_KEY}>
                        <Map
                        defaultCenter={{lat: 22.54992, lng: 0}}
                        defaultZoom={3}
                        gestureHandling={'greedy'}
                        disableDefaultUI={true}
                        />
                    </APIProvider>
                    </div>
                </Col>
            </Row>
            <Row>
                <Col>
                    <Iframe url="https://drive.google.com/embeddedfolderview?id=1u1_sCiLzUliFcKsk-qaxGJZnRS_S_8jf#grid" className="iframe-image"/>
                </Col>
            </Row>
        </Container>
    );
}

export default Wspomnienie;
